import React from "react";
import styles from "./Input.module.css"

type InputProps =  {
    input:{id:string},
    label:string
}
const Input = ({input, label}:InputProps) => {
    return <div className={styles.input}>
        <label htmlFor={input.id}>{label}</label>
        <input {...input}/>
    </div>
}

export default Input;
